function getCookie(e){for(var o=e+"=",t=decodeURIComponent(document.cookie),i=t.split(";"),n=0;n<i.length;n++){for(var r=i[n];" "==r.charAt(0);)r=r.substring(1);if(0==r.indexOf(o))return r.substring(o.length,r.length)}return""}function getCookieAt(e){var o=getListCookie();return o.length<=e?null:getCookie(getNameCookie(o[e]))}function getNameCookie(e){return e.split("=")[0].trim()}function getNameCookieAt(e){var o=getListCookie();return o.length<=e?null:getNameCookie(o[e])}function getListCookie(){for(var e=document.cookie.split(";"),o=[],t=0;t<e.length;t++)o[t]=e[t];return o}function getListCookieName(){for(var e=getListCookie(),o=[],t=0;t<e.length;t++){var i=getNameCookie(e[t]);o[t]=i}return o}function getListCookieValue(){for(var e=getListCookie(),o=[],t=0;t<e.length;t++){var i=getCookieAt(t);o[t]=i}return o}function setCookie(e,o){document.cookie=e+"="+o+";;path=/"}function insertCookieAt(e,o,t){for(var i=getListCookieName(),n=getListCookieValue(),r=t;r<i.length;r++){var g=i[r];deleteCookie(g)}setCookie(e,o);for(r=t+1;r<i.length;r++){g=i[r];var k=n[r];setCookie(g,k)}}function deleteCookie(e){""!=getCookie(e)&&(document.cookie=e+"=;;path=/;expires=Thu, 01 Jan 1970 00:00:01 GMT")}function deleteAllCookie(){for(var e=getListCookie(),o=0;o<e.length;o++){var t=getNameCookie(e[o]);deleteCookie(t)}}